import React , {useState}from 'react';
import './style.scss';

const BurgerMenu=()=>{
    const[status,setStatus] = useState('open');
    return(
        <nav>
            <div className="Burger">
                <i className={status}></i>
                <i className={status}></i>
                <i className={status}></i>
            </div>
        </nav>
    );
}

export default BurgerMenu;
